import React from 'react';

// CSS
import styles from './Tags.module.scss';

const Tags = (props) => {
    return (
        <span
            onClick={() => props.clicked(props.value)}
            className={styles.tag}>
            {props.children}
        </span>
    );
};

export default Tags;
